    <p>개발이 끝난 후 배포까지 해보는 것을 목적으로 책을 보는 사람들 뿐만 아니라 팀원들도 프로젝트 개발 사이클을 경험하면서 개발자로서의 성장을 목표로 진행하고 있습니다.</p>
